import React from "react";

function Game(props) {
  return (
    <div>
      <Link to={`/games/${props.name}`}>
        <img className="gameCard" src={`../public/games/${props.src}`} alt={props.name}/>
      </Link>
    </div>
  );
}

export default Game;
